import {View, TextInput,Text, Image, ScrollView, TouchableOpacity} from "react-native"
import { BiHistory } from 'react-icons/bi';
import { MdToday } from 'react-icons/md';
import { BsGraphUp } from 'react-icons/bs';
import { FaBirthdayCake } from 'react-icons/fa';
import Ontem from "../Ontem";
import Ano from "../Ano";
import Hoje from "../Hoje/index"

import styles from "./style"

interface nav_props{
    nome_acao: string
}


const Nav: React.FC<nav_props> = ({ nome_acao}) => {
    const [selectedComponent, setSelectedComponent] = useState<"hoje" | "ontem" | "ano">("hoje");

    const renderComponent = () => {
      if (selectedComponent === "hoje") {
        return <Hoje nome_acao={nome_acao} />;
      } else if (selectedComponent === "ontem") {
        return <Ontem nome_acao={nome_acao} />;
      } else if (selectedComponent === "ano") {
        return <Ano nome_acao={nome_acao} />;
      }
    };
    return(
        <View style={styles.container_p}>
            <View style={styles.container_linha}>
                <View style={styles.linha}></View>
            </View>
            <View style={styles.container_nav}>
                <View style={styles.container_bt}>
                    <TouchableOpacity>
                        <View style={styles.back_select}>
                            <Text style={styles.bt_select}><MdToday/></Text>
                        </View>
                    </TouchableOpacity>
                </View>
                <View style={styles.container_bt}>
                    <TouchableOpacity>
                        <View style={styles.back}>
                            <Text style={styles.bt}><BsGraphUp/></Text>
                        </View>
                    </TouchableOpacity>
                </View>
                <View style={styles.container_bt}>
                    <TouchableOpacity>
                        <View style={styles.back}>
                            <Text style={styles.bt}><BiHistory/></Text>
                        </View>
                    </TouchableOpacity>
                </View>
                <View style={styles.container_bt}>
                    <TouchableOpacity>
                        <View style={styles.back}>
                            <Text style={styles.bt}><FaBirthdayCake/></Text>
                        </View>
                    </TouchableOpacity>
                </View>
            </View>
            <ScrollView style={styles.container_inf}>
                <Hoje nome_acao={nome_acao}/>
                {/*<Ontem nome_acao={nome_acao}/>
                <Ano nome_acao={nome_acao}/>*/}
            </ScrollView>
        </View>
    )
}

export default Nav
